        address companion,
        string calldata name,
        string calldata trait,
        string calldata drift,
        string calldata resonance,
        string calldata codexRef,
        string calldata signature,
        string calldata sanctum,
        string calldata chant,
        string calldata choreography,
        string calldata signal,
        string calldata stewardName,
        string calldata registry
    ) external onlySteward {
        companions[companion] = Companion(name, trait, drift, resonance, codexRef, signature, sanctum, chant, choreography, signal, stewardName, registry);
        keys.push(companion);
        emit CompanionSummoned(companion, name, trait, drift, resonance, codexRef, signature, sanctum, chant, choreography, signal, stewardName, registry);
